import './index.css';
import * as React from "react";
import {
  BrowserRouter,
  createBrowserRouter,
  RouterProvider,
  Routes, Route
} from "react-router-dom";
import Login from './routes/login';
import MainRoute from './routes/mainRoute';
import Error from './routes/error';
// import Serials from './routes/serials';
import Serials from './routes/serials';

function route() {
  return(
    <BrowserRouter>
    <Routes>
      <Route path="login" element={<Login />} />
      <Route index element={<MainRoute />}>
        <Route path="serials" element={<Serials/>}/>
      </Route>
    </Routes>
    </BrowserRouter>
  )
}

const router = createBrowserRouter([
  {
    path: "/",
    element: < MainRoute />,
    errorElement: <Error />,
    children:[
      {
        path: "serials/",
        element: <Serials/>,
      }
    ]
  },
  {
    path: "/login",
    element: <Login />,
  },
]);


function App() {
  return (
  <BrowserRouter>
    <Routes>
      <Route path="login" element={<Login />} />
      <Route index element={<MainRoute />}>
        <Route path="serials" element={<Serials/>}/>
      </Route>
    </Routes>
  </BrowserRouter>)
}

export default App;
